import React from 'react'
import { Layout, Main } from "../../components";


export const Home = ({ children }) => {
    const handleOnClick = () => {
        console.log('HOLA')
    }

    return (
        <div>
            <Layout>
                <Main>
                    <div>
                        <button onClick={handleOnClick}>Agregar</button>
                    </div>
                </Main>
            </Layout>
        </div>
    )
}
